import React, {useState} from "react";

function Note(props){
    const [isMouseover,setMouseover]=useState(false);
    function handleMouseover(){
        setMouseover=(true);
    }
    function handleMouseout(){
        setMouseover=(false);
    }
    return(
        <div className="note" style={{backgroundColor: isMouseover ? "black" : "#e9f5f0"}} onMouseOver={handleMouseover} onMouseOut={handleMouseout}>
            <h1>{props.title}</h1>
            <p>{props.content}</p>
        </div>
    );
}

export default Note;
